iterations.yara_rule:
rule EvasionBypass {
    meta:
        description = "Evasion bypass patterns identified in malware traces"
        cape_options = "bp0=$pattern1+0,action0=skip,bp1=$pattern2+0,action1=skip,bp2=$pattern3+0,action2=skip,count=0"

    strings:
        $pattern1 = { 01 1A A9 DC FF 15 AC B0 41 01 ?? ?? }
        $pattern2 = { 01 1A A9 F7 FF 15 2C A1 1B 01 ?? ?? }
        $pattern3 = { 01 1A A9 D0 FF 15 40 E1 1B 01 ?? ?? }

    condition:
        any of them
}

